import React from 'react';
import SideUser from './SideUser';
import './Side.scss';

function Side() {
  return (
    <aside class="recommendContainer">
      <div class="myProfile">
        <div class="myProfileLeft">
          <img src="/taeyoung/images/userImg" alt="img" />
          <span>
            <p class="myProfileLeftName">Karim Benzema</p>
            <p>KIMEL/기멜</p>
          </span>
        </div>
        <button class="fllowBt">전환</button>
      </div>

      <div class="recommend">
        <span>회원님을 위한 추천</span>
        <button class="moreBt">모두 보기</button>
      </div>
      <SideUser />
      <SideUser />
      <SideUser />
      <SideUser />
      <SideUser />
    </aside>
  );
}

export default Side;
